import {

  ON_CREATED_ROOM,
  ON_ENTER_IN_ROOM,
  ON_LEAVE_FROM_ROOM,
  ON_START_GAME,
} from '../actiontypes';

const initialState = {};

export const roomReducer = (state = initialState, action) => {
  switch (action.type) {
    default:
      return state;
  }
};
